import './App.css';
import Navigation from './Navigation';
import SearchTweets from './SearchTweets';
import RandomTweets from './RandomTweets';

function App() {
	return (
		<div className="App">
			<Navigation />
			<SearchTweets />
			<RandomTweets />
		</div>
	);
}

export default App;
